INSERT INTO body_parts(body_parts_name) VALUES ('arms'), ('legs'), ('chest'), ('core'), ('back'), ('shoulder');
INSERT INTO locations(location_text) VALUES ('home'), ('gym'), ('outdoor');
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('bicep curl with cable','Stand around 30 - 40cm away from the cable, the feet are firmly on the floor. Take the bar and lift the weight with a fast movements. Lower the weight as with the dumbbell curls slowly and controlled.',3,15,NULL,'FALSE','https://www.youtube.com/embed/rUYrzNgvrzo',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('bicep curl with weights','Hold the weights with the arms streched and hands on your side, and with the palms facing inwards. Bend the arms and bring the weight with a fast movement up. At the same time, rotate your arms by 90 degrees at the very beginning of the movement. At the highest point, rotate a little the weights further outwards. Without a pause, bring them down, slowly.
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('bench dip','Put two benches so far appart, that you can hold onto one with your hands and are just able to reach the other with your feet. The legs stay during the exercise completely stretched. With your elbows facing back, bend them as much as you can. Push yourself up, but don''t stretch out the arms.',3,15,NULL,'FALSE','https://www.youtube.com/embed/MHIU0SSJGcc',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('hammercurls','Hold two dumbbells and sit on a bench with a straight back, the shoulders are slightly rolled backwards. Your pals point to your body. Bend the arms and bring the weight up with a fast movement. Don''t rotate your hands, as with the curls. Without any pause bring the dumbbell down with a slow, controlled movement.
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('push ups','Start with your body streched, your hands are shoulder-wide appart on the ground. Push yourself off the ground till you strech your arms. The back is always straight and as well as the neck (always look to the ground). Lower yourself to the initial position and repeat.',3,15,NULL,'FALSE','https://www.youtube.com/embed/0pkjOk0EiAk',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('tricep dumbbell kickback','Start with a dumbbell in each hand and your palms facing your torso. Keep your back straight with a slight bend in the knees and bend forward at the waist. Your torso should be almost parallel to the floor. Make sure to keep your head up. Your upper arms should be close to your torso and parallel to the floor. Your forearms should be pointed towards the floor as you hold the weights. There should be a 90-degree angle formed between your forearm and upper arm. This is your starting position.Now, while keeping your upper arms stationary, exhale and use your triceps to lift the weights until the arm is fully extended. Focus on moving the forearm.After a brief pause at the top contraction, inhale and slowly lower the dumbbells back down to the starting position.Repeat the movement for the prescribed amount of repetitions.Variations: This exercise can be executed also one arm at a time much like the one arm rows are performed.',3,15,NULL,'FALSE','https://www.youtube.com/embed/ShCYaoHmWmk',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('Hammercurls on Cable','Take a cable in your hands (palms parallel, point to each other), the body is straight. Bend the arms and bring the weight up with a fast movement. Without any pause bring it back down with a slow, controlled movement, but don''t stretch completely your arms.
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('wall pushup','Pushup against a wall',3,15,NULL,'FALSE','https://www.youtube.com/embed/YB0egDzsu18',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('bench press','Lay down on a bench, the bar should be directly above your eyes, the knees are somewhat angled and the feet are firmly on the floor. Concentrate, breath deeply and grab the bar more than shoulder wide. Bring it slowly down till it briefly touches your chest at the height of your nipples. Push the bar up.If you train with a high weight it is advisable to have a spotter that can help you up if you can''t lift the weight on your own.If you train with a high weight it is advisable to have a spotter that can help you up if you can''t lift the weight on your own.With the width of the grip you can also control which part of the chest is trained more: wide grip: outer chest muscles. narrow grip: inner chest muscles and triceps',3,12,NULL,'FALSE','https://www.youtube.com/embed/SCVCLChPQFY',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('Benchpress Dumbbells','The movement is very similar to benchpressing with a barbell, however, the weight is brought down to the chest at a lower point.Hold two dumbbells and lay down on a bench. Hold the weights next to the chest, at the height of your nipples and press them up till the arms are stretched. Let the weight slowly and controlled down.Hold two dumbbells and lay down on a bench. Hold the weights next to the chest, at the height of your nipples and press them up till the arms are stretched. Let the weight slowly and controlled down.',3,12,NULL,'FALSE','https://www.youtube.com/embed/X3YrlBmjWrY',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('burpees','Jump, lay down on your chest, do a pushup then jump, repeat',3,15,NULL,'FALSE','https://www.youtube.com/embed/auBLPXO8Fww',2);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('Cable Cross-over','Begin with cables at about shoulder height, one in each hand. Take a step forward so that one foot is in front of the other, for stability, and so that there is tension on the cables. Bring hands together in front of you. Try to make your hands overlap (so that the cables cross) a few inches.',3,15,NULL,'FALSE','https://www.youtube.com/embed/taI4XduLpTk',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('Bent Over Barbell Row','Holding a barbell with a pronated grip (palms facing down), bend your knees slightly and bring your torso forward, by bending at the waist, while keeping the back straight until it is almost parallel to the floor. Tip: Make sure that you keep the head up. The barbell should hang directly in front of you as your arms hang perpendicular to the floor and your torso. This is your starting position.
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('dealifts','Stand firmly, with your feet slightly more than shoulder wide apart. Stand directly behind the bar where it should barely touch your shin, your feet pointing a bit out. Bend down with a straight back, the knees also pointing somewhat out. Grab the bar with a shoulder wide grip, one underhand, one reverse grip.
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('Long-Pulley (low Row)','Sit down, put your feet on the supporting points and grab the bar with a wide grip. Pull the weight with a rapid movement towards your belly button, not upper. Keep your arms and elbows during the movement close to your body. Your shoulders are pulled together. Let the weight slowly down till your arms are completely stretched.',3,15,NULL,'FALSE','https://www.youtube.com/embed/GZbfZ033f74',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('Hyperextensions','Lay on the hyperextension pad with the belly button just at the leading edge, the upper body can hang freely. Tense your whole back''s muscles and bring your upper body up till it is horizontal, but not more. Go slowly down and don''t relax your muscles.',3,15,NULL,'FALSE','https://www.youtube.com/embed/qtjJUWCnDyE',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('superman','Lay flat on your stomach with your arms extended in front of you on the ground as your legs are lying flat. Lift both your arms and legs at the same time, as if you were flying, and contract the lower back. Make sure that you are breathing and, depending on your fitness level, hold the movement for at least two to five seconds per repetition.',3,15,NULL,'FALSE','https://www.youtube.com/embed/z6PJMT2y8GQ',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('arnold shoulder press','Start light until you master the form. Hold a dumbbell in each hand with your arm bent, as in the top of a biceps curl, so your palms are facing you. Now, instead of pushing straight up, spread your arms to each side laterally, then press your arms up and twist your hands so your palms face forwards. For full range of motion, finish by pushing your head forwards and reaching as high as you can so your biceps are close to your ears.
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('lateral raises','You don''t need much room or equipment to perform a side lateral raise. All you need is a set of dumbbells and enough space to raise your arms in a "T" formation out to each side.
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('shoulder fly','The shoulder fly (also known as a lateral raise) works the deltoid muscle of the shoulder. The movement starts with the arms straight, and the hands holding weights at the sides or in front of the body. Body is in a slight forward-leaning position with hips and knees bent a little. Arms are kept straight or slightly bent, and raised through an arc of movement in the coronal plane that terminates when the hands are at approximately shoulder height. Weights are lowered to the starting position, completing one rep. When using a cable machine the individual stands with the coronal plane in line with the pulley, which is at or near the ground.[9] The exercise can be completed one shoulder at a time (with the other hand used to stabilize the body against the weight moved), or with both hands simultaneously if two parallel pulleys are available.',3,15,NULL,'FALSE','https://www.youtube.com/embed/GplnXF7e2SA',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('shoulder press,on machine','Begin the movement by sitting on the machine and aligning the seat if possible to align the handles with your upper chest.Grasp the bar or handles so they are shoulder or slightly higher level to you. Your palms are facing out. Be sure to keep your back straight.Press the bar or weight straight up. Be sure not to lock your elbows at the top.Hold for 1-2 seconds then lower slowly for to the starting position.',3,15,NULL,'FALSE','https://www.youtube.com/embed/U5ClWAGVZNw',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('shrugs, dumbbell','Stand with straight body, the hands are hanging freely on the side and hold each a dumbbell. Lift from this position the shoulders as high as you can, but don''t bend the arms during the movement. On the highest point, make a short pause of 1 or 2 seconds before returning slowly to the initial position.When training with a higher weight, make sure that you still do the whole movement!',3,15,NULL,'FALSE','https://www.youtube.com/embed/g6qbq4Lf1FI',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('dumbbell globlet squat','Grasp dumbbell with both hands at the sides of the upper plates. Hold dumbbell in front of chest, close to torso. Place feet about shoulderwide apart, keep knees slightly bent.Squat down until thighs are parallel to floor. Keep back straight, bend and move hips backward to keep knees above feet. Return, keep knees slightly flexed. Repeat. Keep bodyweight on heels and look ahead or slightly above to keep back straight.',3,12,NULL,'FALSE','https://www.youtube.com/embed/mF5tnEBrdkc',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('forward lunge','tart at a standing position. Lift and move one foot forward until your front calf and thigh are at 90 degrees to one another. At the same time, bend your back leg forward while keeping the back foot in place. Return to starting position. Repeat with other leg.',3,15,NULL,'FALSE','https://www.youtube.com/embed/mUf28ZDa5tg',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('high knees','Start with legs at a comfortable standing width. Run in place, bringing knees to or above waist level',3,20,NULL,'FALSE','https://www.youtube.com/embed/DfjpR6dzLVg',2);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('jumping jacks','A jumping jack or star jump, also called side-straddle hop in the US military, is a physical jumping exercise performed by jumping to a position with the legs spread wide and the hands going overhead, sometimes in a clap, and then returning to a position with the feet together and the arms at the sides. Stretch your arms out and over your head as you jump',3,20,NULL,'FALSE','https://www.youtube.com/embed/gG2Z1siSvkk',2);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('kettlebell swings','Hold the kettlebell securely in both hands. Keep your back flat throughout the move, avoiding any rounding of the spine.Keeping your knees "soft", hinge your hips backwards, letting the kettlebell swing between your knees.You want to bend from the hips as far as you can without letting your back round forwards. Then, snap your hips forwards quickly and standing up straight, locking your body in an upright posture.The speed you do this will cause your arms and the kettlebell to swing up in front of you. Don''t try to lift the kettlebell with your arms. The snapping forwards of your hips will cause the kettlebell to swing forwards through momentum. Depending on the weight of the kettlebell and the speed of your hip movement, your arms will swing up to about shoulder height. At the top of this swing, let your hips hinge backwards again as the kettlebell swings back down to between your legs and the start of the next repetition.',3,10,NULL,'FALSE','https://www.youtube.com/embed/mKDIuUbH94Q',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('leg presses (narrow)','Sit on the machine and put your feet on the platform so far apart  that you could just put another foot in between them. The feet are parallel and point up.Lower the weight so much, that the knees form a right angle. Push immediately the platform up again, without any pause. When in the lower position, the knees point a bit outwards and the movement should be always fluid.Fluid movements with no pauses at the top or the bottom',3,15,NULL,'FALSE','https://www.youtube.com/embed/0LIk95w0r4U',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('leg presses (wide)','Sit on the machine and put your feet on the platform, a bit more than shoulder wide. The feet are turned outwards by a few degrees. Lower the weight so much, that the knees form a right angle. Push immediately the platform up again, without any pause. When in the lower position, the knees point a bit outwards and the movement should be always fluid.',3,15,NULL,'FALSE','https://www.youtube.com/embed/rGDx6NcOwVs',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('romanian deadlift','Use an overhand grip to hold the bar at hip level. Draw your shoulders back and keep your spine straight.Push your hips back as you slowly lower the bar toward your feet. Press your hips forward to come into a standing position with the barbell in front of your thighs.',3,12,NULL,'FALSE','https://www.youtube.com/embed/WtWtjViRsKo',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('squat jumps','Stand with your feet just outside shoulder-width apart, toes turned slightly out. Squat down with your weight in your heels, proud chest, knees tracking over toes, and a neutral spine. When you hit the bottom of your squat, squeeze your butt tight and drive hard through your legs and heels as you launch straight up, pelvis forward, pushing off your toes at the last moment of contact with the floor. Land softly, then use the momentum from landing to go right into your next squat. That''s one rep.',3,20,NULL,'FALSE','https://www.youtube.com/embed/YGGq0AE5Uyc',2);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('run-treadmill',NULL,1,NULL,NULL,'FALSE','https://www.youtube.com/embed/BwuaiNWBodo',2);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('run-interval training','WARMUP: 3 minutes 
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('sumo squats','Stand with your feet wider than your shoulders, with your toes pointed out at a 45 degree angle and barbell on your shoulder.While keeping your back straight, descend slowly by bending at the knees and hips as if you are sitting down (squatting).Lower yourself until your quadriceps and hamstrings are parallel to the floor.Return to the starting position by pressing upwards and extending your legs while maintaining an equal distribution of weight on your forefoot and heel.',3,15,NULL,'FALSE','https://www.youtube.com/embed/sqDGkIBYPAk',1);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('crunches','Lay down on your back a soft surface, the feet are on the floor. Ask a partner or use some other help (barbell, etc.) to keep them fixed, your hands are behind your head. From this position move your upper body up till your head or elbows touch your knees. Do this movement by rolling up your back.',3,20,NULL,'FALSE','https://www.youtube.com/embed/HiRsmHH7psA',3);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('sit-ups','Sit on a mat, your calves are resting on a bench, the knees make a right angle. Hold your hands behind your neck. Go now up with a rolling movement of your back, you should feel how the individual vertebrae lose contact with the mat. At the highest point, contract your abs as much as you can and hold there for 2 sec. Go now down, unrolling your back.',3,20,NULL,'FALSE','https://www.youtube.com/embed/5bOjqyL0PGE',3);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('deadbug','Lie on your back, with your hips and knees bent to 90°. Raise both arms toward the ceiling. Pull your lower back to the floor to eliminate the gap. Start by pressing one leg out, and tapping the heel to the floor. "As you extend one leg, exhale as much as you can, keeping your lower back glued to the floor," Dunham says. When you can’t exhale any more, pull your knee back to the starting position. Make this more difficult by holding weight in your hands, or by lowering opposite arm and leg',3,20,NULL,'FALSE','https://www.youtube.com/embed/W5jw2maZITs',3);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('plank','Get into a position on the floor supporting your weight on your forearms and toes. Arms are bent and directly below the shoulder. Keep your body straight at all times and hold this position as long as possible. To increase difficulty an arm or leg can be raised while performing this exercise.',3,0,NULL,'FALSE','https://www.youtube.com/embed/KsLDmz9gedY',3);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('side crunch','Hold weight in one hand. Bend side ways to the knee. Pull upo to upright position using your obliquus.',3,20,NULL,'FALSE','https://www.youtube.com/embed/Wa7QX5a0lP8',3);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('turkish getup','Starting on back, move to the standing position with dumbbell in one hand.  Switch hands between reps.',3,20,NULL,'FALSE','https://www.youtube.com/embed/u_1a2ElDo9Y',3);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('overhand cable curl','Hands at shoulder height, curl arms in toward head, then back out.',3,20,NULL,'FALSE','https://www.youtube.com/embed/NJQROeaBiVE',3);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('russian twist','To perform the Russian twist one sits on the floor and bends both knees while feet are be kept together and held slightly above the ground (or put under a stable surface). Ideally, the torso is kept straight with the back kept off the ground at a 45 degree angle with arms held together away from the body in a straight fashion and hands kept locked together like a ball or one can hold a weight to increase the difficulty. Next, the arms should be swung from one side to another in a twisting motion, with each swing to a side counting as one repetition. The slower one moves the arms from side to side, the harder the exercise becomes, working the abdomen that much better. When moving one''s arms during the exercise, it is crucial to not stop between repetitions or else one will lose the effect of working the abdomen. As with all exercise, consistent breathing in and out during the exercise is important as one must ensure proper oxygen flow.',3,20,NULL,'FALSE','https://www.youtube.com/embed/JyUqwkVpsi8',3);
INSERT INTO workout(workout_name,workout_description,sets,repetition,likes,is_custom,url_link,category_id) VALUES ('skipping',NULL,0,0,NULL,'FALSE','https://www.youtube.com/embed/FJmRQ5iTXKE',2);
